import React from 'react'

import { Link } from 'react-router-dom'

const Login = props => {
  return (
    <div>
      <p>Login</p>
      <Link to='/home'> To home</Link>
      <button onClick={() => props.history.push('/home')}></button>
    </div>
  )
}

export default Login
